(function() {

  var $list = document.querySelector('.list');
  var rows = [];
  var pauseIcon = 'data:image/png;base64,';
  var playIcon = 'data:image/png;base64,';

  function save() {
    var js = JSON.stringify(rows.map(function(row) {
      return { v: row.input.value, t: row.totalTime }
    }));

    localStorage.setItem('d', js);
  }

  setInterval(save, 10e3);

  function load() {
    var js = localStorage.getItem('d');
    if (!js) return;

    JSON.parse(js).forEach(function(data) {
      new Row(data.v, data.t);
    });
  }

  function Row(title, time) {
    this.running = false;
    this.totalTime = time || 0;
    this.startDate = null;

    var li = document.createElement('li');

    var input = document.createElement('input');
    input.className = 'task-title';
    input.value = title || '';
    input.placeholder = 'Enter a task title...';

    var label = document.createElement('label');
    label.textContent = this.getTimeDisplay();

    var play = document.createElement('img');
    play.src = pauseIcon;

    var del = document.createElement('img');
    del.src = 'blah.jpg';

    li.appendChild(input);
    li.appendChild(label);
    li.appendChild(play);
    li.appendChild(del);

    rows.push(this);

    this.el = li;
    this.input = input;
    this.label = label;
    this.play = play;
    this.del = del;

    var self = this;

    this.input.addEventListener('keydown', function(e) {
      if (e.keyCode === 13) self.toggle();
    });

    this.input.addEventListener('change', function() {
      if (self.running) {
        self.updateTitle();
      }
    });

    this.play.addEventListener('click', function() {
      if (self.running) {
        self.stop();
      } else {
        self.start();
      }
    });

    this.del.addEventListener('click', function() {
      self.destroy();
    });

    $list.appendChild(li);

    this.input.focus();
  }

  Row.prototype.start = function() {
    rows.forEach(function(row) {
      row.stop(true);
    });

    this.running = true;
    this.startDate = Date.now();
    this.play.src = playIcon;
    this.updateTitle();

    var self = this;
    this.runningId = setInterval(function() {
      self.totalTime += Date.now() - self.startDate;
      self.startDate = Date.now();
      self.render();
      self.updateTitle();
    }, 30e3);
  };

  Row.prototype.stop = function(skipTitleUpdate) {
    this.running = false;
    this.play.src = pauseIcon;
    if (!skipTitleUpdate) this.updateTitle();
    clearInterval(this.runningId);
  };

  Row.prototype.toggle = function() {
    if (this.running) {
      this.stop();
    } else {
      this.start();
    }
  };

  Row.prototype.render = function() {
    this.label.innerText = this.getTimeDisplay();
  };

  Row.prototype.updateTitle = function() {
    if (!this.running) {
      document.title = 'Time Tracker';
    } else {
      document.title = this.getTimeDisplay() + ' - ' + (this.input.value || 'Untitled');
    }
  };

  Row.prototype.getTimeDisplay = function() {
    var totalSec = this.totalTime / 1e3;

    var hours = Math.floor(totalSec / 3600).toString();
    var minutes = Math.floor((totalSec / 60) % 60).toString();

    if (minutes.length === 1) minutes = '0' + minutes;

    return hours + ':' + minutes;
  };

  Row.prototype.destroy = function() {
    this.stop();
    this.el.remove();

    var self = this;
    rows = rows.filter(function(row) {
      return row !== self;
    });
  };

  document.querySelector('.add-new').addEventListener('click', function() {
    new Row();
  });

  load();

  window.Row = Row;

})();
